		explicit ENetPacketScopeHolder(ENetPacket* packet)
			: _packet(GORN_REQUIRE_NOT_NULL(packet))
		{ }

		~ENetPacketScopeHolder()
		{
			enet_packet_destroy(_packet);
		}
	};

	class PacketMemoryStreamBuffer : public std::streambuf
	{
	public:
		explicit PacketMemoryStreamBuffer(ENetPacket* packet)
		{
			GORN_CHECK(packet, NullPointerException());
			auto data = (char*)(packet->data);
			setg(data, data, data + packet->dataLength);
		}
	};

	struct AlreadyInitializedException : public Exception
	{
		AlreadyInitializedException()
			: Exception("NetworkSession is already initialized")
		{ }
	};

	struct NotInitializedException : public Exception
	{
		NotInitializedException()
			: Exception("NetworkSession is not initialized")
		{ }
	};
