	void NetworkSession::Connect(const std::string& hostName, enet_uint16 hostPort)
	{
		GORN_CHECK(!IsInitialized(), AlreadyInitializedException());

		ENetHost* host = nullptr;
		ENetPeer* peer = nullptr;

		try
		{
			host = enet_host_create(nullptr, 1, 1, 0, 0);
			GORN_CHECK(host, "enet_host_create() failed");
			GORN_CHECK(enet_host_compress_with_range_coder(host) == 0, "enet_host_compress_with_range_coder() failed");

			const auto hostAddress = GetAddressFromString(hostName, hostPort);

			peer = enet_host_connect(host, &hostAddress, NetworkChannel::Count, ProtocolVersion);
			GORN_CHECK(peer, StringBuilder() % "Failed to initialize " % hostName % ":" % hostPort % " ENet host connection");

			ENetEvent event;
			const auto pollResult = enet_host_service(host, &event, ConnectionTimeout);
			if (pollResult > 0)
			{
				GORN_CHECK(event.type == ENET_EVENT_TYPE_CONNECT, StringBuilder() % "Failed to connect to " % hostName % ":" % hostPort % " ENet host");
			}
			else
			{
				GORN_CHECK(pollResult != 0, StringBuilder() % hostName % ":" % hostPort % " ENet host connection timeout");
				GORN_THROW("enet_host_service() failed");
			}
		}
		catch (const std::exception& ex)
		{
			if (peer)
			{
				enet_peer_reset(peer);
			}

			if (host)
			{
				enet_host_destroy(host);
			}

			GORN_THROW(ex);
		}

		_host = host;

		_serverConnection = std::make_shared<NetworkConnection>(NetworkId::Null, peer);

		_hostName = hostName;
		_hostPort = hostPort;

		_tickerConnection = _ticker.OnTick().connect<&NetworkSession::DoOnTick>(this);
		_ticker.SetTickRate(ClientTickRate);

		_mode = Mode::Client;

		_onPeerConnected.publish(NetworkId::Null, _serverConnection);
	}

	const NetworkConnectionPtr& NetworkSession::GetConnection() const
	{
		GORN_CHECK(IsClient(), "GetConnection() is available in client-mode only");

		return _serverConnection;
	}

	void NetworkSession::Listen(const std::string& hostName, enet_uint16 hostPort, size_t maxClientsCount)
	{
		GORN_CHECK(!IsInitialized(), AlreadyInitializedException());

		const auto hostAddress = GetAddressFromString(hostName, hostPort);
		ENetHost* host = nullptr;

		try
		{
			host = enet_host_create(&hostAddress, maxClientsCount, NetworkChannel::Count, 0, 0);
			GORN_CHECK(host, StringBuilder() % "Failed to create " % hostName % ":" % hostPort % " ENet host");
			GORN_CHECK(enet_host_compress_with_range_coder(host) == 0, "enet_host_compress_with_range_coder() failed");
		}
		catch (const std::exception& ex)
		{
			if (host)
			{
				enet_host_destroy(host);
			}

			GORN_THROW(ex);
		}

		_host = host;

		_hostName = hostName;
		_hostPort = hostPort;

		_tickerConnection = _ticker.OnTick().connect<&NetworkSession::DoOnTick>(this);
		_ticker.SetTickRate(ServerTickRate);

		_mode = Mode::Server;
	}

	const NetworkConnectionPtr& NetworkSession::GetConnection(NetworkId id) const
	{
		GORN_CHECK(IsServer(), "GetConnection() is available in server-mode only");

		const auto connectionIt = _clientConnections.find(id);
		GORN_CHECK(connectionIt != _clientConnections.end(), StringBuilder() % "Connection " % id % " not found");

		return connectionIt->second;
	}

	NetworkConnectionPtr NetworkSession::TryGetConnection(NetworkId id) const
	{
		GORN_CHECK(IsServer(), "TryGetConnection() is available in server-mode only");

		const auto connectionIt = _clientConnections.find(id);

		return connectionIt != _clientConnections.cend() ? connectionIt->second : nullptr;
	}

	void NetworkSession::Process()
	{
		if (!IsInitialized())
		{
			return;
		}

		while (true)
		{
			GORN_CHECK(enet_host_service(_host, 0, 0) >= 0, "enet_host_service() failed");

			ENetEvent event;

			const auto checkResult = enet_host_check_events(_host, &event);
			GORN_CHECK(checkResult >= 0, "enet_host_check_events() failed");
			if (checkResult == 0)
			{
				break;
			}

			switch (event.type)
			{
			case ENET_EVENT_TYPE_CONNECT:
			{
				if (event.data != ProtocolVersion)
				{
					/* TODO: DisconnectPeer(event.peer, DisconnectReason::ProtocolMismatch) */
					enet_peer_disconnect(event.peer, 0);
					break;
				}

				const auto id = GenerateClientId();

				const auto connection = AddConnection(id, event.peer);

				_onPeerConnected.publish(id, connection);

				break;
			}
			case ENET_EVENT_TYPE_DISCONNECT:
			{
				const auto isClient = IsClient();

				DisconnectPeer(event.peer);

				if (isClient)
				{
					return;
				}

				break;
			}
			case ENET_EVENT_TYPE_RECEIVE:
			{
				ENetPacketScopeHolder packetHolder(event.packet);

				PacketMemoryStreamBuffer packetStreamBuffer(event.packet);
				std::istream stream(&packetStreamBuffer);
				const auto header = NetworkEventDeserializer::DeserializeHeader(stream);

				if (!IsEventValid(header))
				{
					if (IsServer())
					{
						DisconnectPeer(event.peer);
					}

					break;
				}

				const auto id = header.GetId();
				HandleEvent(id, stream);

				break;
			}
			}
		}

		_eventDispatcher.update();

		_ticker.Process();
	}

	void NetworkSession::Shutdown()
	{
		_tickerConnection.release();
		_ticker.SetTickRate(std::nullopt);

		std::optional<NetworkId> clientId;

		switch (_mode)
		{
		case Mode::Client:
		{
			clientId = _serverConnection->GetId();

			_serverConnection->Disconnect(false);
			_serverConnection.reset();

			enet_host_flush(_host);
			enet_host_destroy(_host);
			_host = nullptr;

			break;
		}
		case Mode::Server:
		{
			for (const auto& connection : _clientConnections)
			{
				connection.second->Disconnect(false);
			}
			_clientConnections.clear();

			enet_host_flush(_host);
			enet_host_destroy(_host);
			_host = nullptr;

			break;
		}
		default:
			break;
		}

		_eventDispatcher.clear();

		_mode = Mode::NotInitialized;

		_hostPort = 0;
		_hostName.clear();

		if (clientId)
		{
			_onPeerDisconnected.publish(*clientId);
		}
	}

	template < NetworkEventId EventId >
	void NetworkSession::RegisterEventHandler()
	{
		GORN_CHECK(_eventHandlers.count(EventId) == 0, StringBuilder() % "EventId " % EventId % " is already registered");

		_eventHandlers.emplace(EventId, std::bind(&NetworkSession::HandleEvent<EventId>, this, std::placeholders::_1));
	}

