	{
		enet_host_flush(_host);

		DoOnPostTick();
	}

	void NetworkSession::DoOnPostTick()
	{
		_onPostTick.publish(NetworkTickInfo(_host->totalReceivedData, _host->totalSentData));

		_host->totalReceivedData = 0;
		_host->totalSentData = 0;
	}

	void NetworkSession::DisconnectPeer(ENetPeer* peer)
	{
		switch (_mode)
		{
		case Mode::Client:
		{
			Shutdown();

			break;
		}
		case Mode::Server:
		{
			/* TODO: Reset peer if no connection was found? */
			if (const auto id = TryRemoveConnection(peer))
			{
				_onPeerDisconnected.publish(id);
			}

			break;
		}
		default:
			GORN_THROW(NotInitializedException());
		}
	}

	bool NetworkSession::IsEventValid(const NetworkEventHeader& header) const
	{
		switch (_mode)
		{
		case Mode::Client:
		{
			return header.GetSender().IsServer();
		}
		case Mode::Server:
		{
			const auto sender = header.GetSender();

			return sender.IsValid() && _clientConnections.count(sender);
		}
		default:
			GORN_THROW(NotInitializedException());
		}
	}

	void NetworkSession::HandleEvent(NetworkEventId id, std::istream& stream)
	{
		const auto eventHandlerIt = _eventHandlers.find(id);
		GORN_CHECK(eventHandlerIt != _eventHandlers.cend(), StringBuilder() % "Failed to handle " % id % " event id");

		eventHandlerIt->second(stream);
	}

	template < NetworkEventId EventId >
	void NetworkSession::HandleEvent(std::istream& stream)
	{
		const auto event = NetworkEventDeserializer::DeserializeEvent<EventId>(stream);

		_eventDispatcher.enqueue(event);
	}

	NetworkConnectionPtr NetworkSession::AddConnection(NetworkId id, ENetPeer* peer)
	{
		GORN_CHECK(_clientConnections.count(id) == 0, StringBuilder() % "Connection " % id % " already exists");

		peer->data = std::make_unique<NetworkId>(id).release();

		const auto connection = std::make_shared<NetworkConnection>(NetworkId::Server, peer);

		_clientConnections.emplace(id, connection);

		return connection;
	}

	NetworkId NetworkSession::TryRemoveConnection(ENetPeer* peer)
	{
		if (!peer->data)
		{
			return NetworkId::Null;
		}

		const auto id = *reinterpret_cast<NetworkId*>(peer->data);

		const auto connectionIt = _clientConnections.find(id);
		if (connectionIt == _clientConnections.cend())
		{
			return NetworkId::Null;
		}

		connectionIt->second->Disconnect(false);
		_clientConnections.erase(connectionIt);

		return id;
	}
}

